import React from 'react';
import { Container, Nav, Navbar, NavDropdown, NavItem } from 'react-bootstrap';
import { Switch } from 'react-router';
import { Link, Route,useRouteMatch } from 'react-router-dom';
import CreateReview from '../../Components/CreateReview/CreateReview';
import AdminRoute from '../../Firebase/AdminRoute';
import PrivateRoute from '../../Firebase/PrivateRoute';
import useAuth from '../../Firebase/useAuth';
import AddProduct from '../AddProduct/AddProduct';
import CheckOutAllOrder from '../CheckOutAllOrder/CheckOutAllOrder';
import CreateAdmin from '../CreateAdmin/CreateAdmin';
import ManageProducts from '../ManageProducts/ManageProducts';
import MyCart from '../My Cart/MyCart';
import Products from '../Products/Products';
import './Dashboard.css'

const Dashboard = () => {
    const{user}=useAuth();
    let { path, url } = useRouteMatch();
    return (
        <div>
            <Navbar collapseOnSelect sticky="top" expand="lg" bg="secondary" variant="dark">
  <Container>
  <Navbar.Brand><Link to="/" className="nav-link text-light">PEARLS</Link></Navbar.Brand>
  <Navbar.Toggle aria-controls="responsive-navbar-nav" />
  <Navbar.Collapse id="responsive-navbar-nav">
    <Nav className="me-auto">
      <Link to="/" className="nav-link">Home</Link>
    </Nav>
    <Nav>
    <Navbar.Brand > <NavItem>   <Link  to="/"><img width="40px" className="rounded-circle" src={user.photoURL} alt="" /></Link> </NavItem> </Navbar.Brand>
    </Nav>
  </Navbar.Collapse>
  </Container>
</Navbar>
            <div className="row my-3">
                <div className="col-2 bg-secondary position-fixed rounded-sidenav">
                <div className="">
                <Link className="nav-link text-light " to={`${url}/checkoutallorder`}>CHECKOUT ALL ORDER</Link>
                <Link className="nav-link text-light " to={`${url}/createadmin`}>CREATE ADMIN</Link>
                <Link className="nav-link text-light " to={`${url}/manageproducts`}>MANAGE PRODUCTS</Link>
                <Link className="nav-link text-light " to={`${url}/addproduct`}>ADD PRODUCT</Link>
                <Link className="nav-link text-light " to={`${url}/createreview`}>CREATE REVIEW</Link>
                <Link className="nav-link text-light " to={`${url}/createadmin`}>CREATE ADMIN</Link>
                <Link className="nav-link text-light " to={`${url}/createadmin`}>CREATE ADMIN</Link>
                
                </div>
                </div>
                <div className="col-2"></div>
                <div className="col-10"> 
                <Switch>
                    <AdminRoute exact path={`${path}/checkoutallorder`}>
                       <CheckOutAllOrder></CheckOutAllOrder>
                    </AdminRoute>
                    <AdminRoute exact path={`${path}/createadmin`}>
                       <CreateAdmin></CreateAdmin>
                    </AdminRoute>
                    <AdminRoute exact path={`${path}/manageproducts`}>
                       <ManageProducts></ManageProducts>
                    </AdminRoute>
                    <AdminRoute exact path={`${path}/addproduct`}>
                       <AddProduct></AddProduct>
                    </AdminRoute>
                    <PrivateRoute exact path={`${path}/mycart`}>
                        <MyCart></MyCart>
                    </PrivateRoute>
                    <PrivateRoute exact path={`${path}/createreview`}>
                        <CreateReview></CreateReview>
                    </PrivateRoute>
                </Switch>
                </div>
            </div>
        </div>
    );
};

export default Dashboard;
